full_text:
@cultofsasha YES THIS IS ME TOO.

Why is brain so dumb?

&lt;You are a great writer!&gt; https://t.co/wtIsWte0hM

@cultofsasha I honestly think today is my last day at a lot of things.

26 years is too long to lie to one's self. At some point the failures just become something bigger than the sum of their parts.

It's time. I just wish I knew how to say goodbye to it. And what to do with all those books. https://t.co/M0Sff9GNtE

@jburkespraker @LRyan_Storms I was thinking the same thing. I'd be outraged.

I don't think we know yet. Her 2005 book was with Simon &amp; Schuster.

I hope she calls it "Alternative Facts about the Bowling Green Massacre" and that every copy gets returned to the printer.

@LillianRhaine @Nightshade386 I'm in PA as well. In Montco. There are about 488k votes left to count. 120k are in Philly. Current split: 135,673.

Here's where outstanding ballots lie:

https://t.co/tJZJk0grjo

@Blind_Nycteris A GOP legislature is responsible for the delay in PA counting. Because of them, mal in ballots have to be (1) in a secrecy envelope and (2) held until 7 am on election day until they are counted.

Now they're complaining about it.

Like a party of toddlers.

@DarbyHarn I got your back. This makes me miss my old days in politics. Drinking bad coffee and answering six cell phones while votes are counted. Man. What a rush.

166,146 separate them now. 700k left to count.

We got this. Just keep pushing.

@iamfierless True (gross) story: I once woke to Matt loudly saying my name. He was sitting up with his hands out, cupped, as if something had been poured into them. "Get a rag. Fast. Now."

The cat was sleeping on him &amp; began to have a hairball. He caught it in his hands.

Strangest 2 am ever

@eaglescandy I did theater in college. The choreographer made my feet work. You are magicians!

I am blessed w/ amazing writer friends &amp; a genius editor. But there's something about these rainy fall days that make the writing juices flow.

(Good news about the less than lethal force ban!)

@therealzevgood @KatyNDarkQueen @BrianDHinson1 Wait.

A blood-sucking, fire-spitting mermaid with wings? Like a seahorse?

I'm here for it.

@RWeberWrites 23 rejections is like a crumb in the bottom of a bread bin. You have to hit the right agent in the right mood at the right exact moment over the entirety of space and time.

And all genres are different. Audience size. Author saturation.

You're literally being graded on a scale.

@jodipicoult @BrigidKemmerer A reader once emailed an author I know to point out that their book was not a suitable romance novel.

The reader technically wasn't wrong.

It wasn't a romance novel at all.

@WeAreMarsBook #4 in a series of stand alone titles set in a small Maine town. Came out earlier this month.

"With broken dreams and an empty wallet, Kyle starts over in his tiny Maine hometown. Lucky for him, hope is free."

https://t.co/z4finAaIP4

@poeticengineer @Polar_Bear_Edit Lauren does make a kick-ass pirate!

I am having a similar day. The anxiety is at an 11. I just had to tell my new boss that I'm not a trash can for every bit of chaos the office staff creates. I may not have this job tomorrow. I might be okay with that.

Pass me the whiskey!

@kendown Dehydrated liquid sounds like car blinker fluid. ü§£ 

I'm kidding. I know what you mean. Predator Pee is a popular brand.

I use Deer Off, but they get used to it.

@alexhareland Do we have to do this for the rest of the year? I just want to know if I should stagger my breath or if I can let it all out now. 

Wait.

No, I can keep going.

@therealzevgood I really don't think so.

One woman told me that mainstream fiction isn't real. It's romance or mystery. Period.

I'm like... so "A River Runs Thru It" wasn't character-driven commercial / mainstream / literary fiction? Was it fish porn?

@frankblack2012 Same. With Zquil / melatonin I can fall asleep, but not for more than 2 hours. Most nights, I sleep from 9:30 to 11:30, then from 4 to 5:30 or 6.

Most people fear sleeping and not waking up one day. I fear waking and never sleeping again.

I wish I could nap. Sounds delightful.

@PAHouseGOP If life was really that important to you, you'd have protected the people of Lebanon Co.

When you show citizens what you stand for as a party, don't blame us for figuring it out. 

After getting what you asked for, wouldn't you rather celebrate?

@Natkim17052342 Wasn't great on my phone either.

In Arizona, they do need masks.

We've removed so much logic from our education system (by design), that most of what happens here is incomprehensible anymore.

@wired4story @HappyTreeJC Click the menu then "how it works."

My parents loved this. 

